import React from 'react';
import TokenExchange from './components/TokenExchange';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <h1>
          <img 
            src="/gpex_logo_whtie_1000px.webp" 
            alt="GPEX Token Exchange" 
            className="logo" 
            style={{
              width: '200px',
              height: 'auto'
            }}
          />
        </h1>
      </header>
      <main>
        <TokenExchange />
      </main>
    </div>
  );
}

export default App;
